import React, { useState, useContext, useEffect } from "react";
import axios from "axios";
import { AuthContext } from "../context/AuthContext";
import { useLocation } from "react-router-dom";
import "./Service.css";

const ApplyService = () => {
  const { token } = useContext(AuthContext);
  const location = useLocation();

  // ðŸ‘‰ GET SERVICE FROM URL
  const query = new URLSearchParams(location.search);
  const selectedService = query.get("service");

  const [formData, setFormData] = useState({
    serviceType: "",
    fullName: "",
    address: "",
    mobile: ""
  });

  const [documents, setDocuments] = useState([]);
  const [message, setMessage] = useState("");

  // âœ… AUTO SET SERVICE FROM SERVICES PAGE
  useEffect(() => {
    if (selectedService) {
      setFormData((prev) => ({
        ...prev,
        serviceType: selectedService
      }));
    }
  }, [selectedService]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleFiles = (e) => {
    setDocuments(e.target.files);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    data.append("serviceType", formData.serviceType);
    data.append("fullName", formData.fullName);
    data.append("address", formData.address);
    data.append("mobile", formData.mobile);

    for (let i = 0; i < documents.length; i++) {
      data.append("documents", documents[i]);
    }

    try {
      const res = await axios.post(
        "http://localhost:5000/api/services/apply",
        data,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            "Content-Type": "multipart/form-data"
          }
        }
      );

      setMessage(res.data.message);

      setFormData({
        serviceType: selectedService || "",
        fullName: "",
        address: "",
        mobile: ""
      });

      setDocuments([]);
    } catch (err) {
      setMessage(err.response?.data?.message || "Failed to submit");
    }
  };

  return (
    <div className="apply-service-container">
      <h2>Apply for Service</h2>

      {message && <p className="msg">{message}</p>}

      <form onSubmit={handleSubmit}>
        {/* SERVICE TYPE */}
        <label>Service</label>
        <select
          name="serviceType"
          value={formData.serviceType}
          onChange={handleChange}
          required
          disabled={!!selectedService}   // ðŸ”’ lock if came from Services page
        >
          <option value="">Select Service</option>
          <option value="Birth Certificate">Birth Certificate</option>
          <option value="Death Certificate">Death Certificate</option>
          <option value="Income Certificate">Income Certificate</option>
          <option value="Sanitation">Sanitation</option>
          <option value="Road & Development">Road & Development</option>
        </select>

        {/* USER DETAILS */}
        <input
          type="text"
          name="fullName"
          value={formData.fullName}
          onChange={handleChange}
          placeholder="Full Name"
          required
        />

        <input
          type="text"
          name="address"
          value={formData.address}
          onChange={handleChange}
          placeholder="Address"
          required
        />

        <input
          type="text"
          name="mobile"
          value={formData.mobile}
          onChange={handleChange}
          placeholder="Mobile Number"
          required
        />

        {/* DOCUMENT UPLOAD */}
        <label>Upload Documents</label>
        <input type="file" multiple onChange={handleFiles} />

        <button type="submit">Submit Application</button>
      </form>
    </div>
  );
};

export default ApplyService;
